// import logo from './logo.svg';
import Tabs from 'react-bootstrap/Tabs'
import Tab from 'react-bootstrap/Tab'
import "../styles/ThreeTabs.css"
import CategoriesTable from './CategoryTable';
import BooksTable from './BooksTable';

function ThreeTabs() {
  return (
    <div className="">
      <Tabs
    defaultActiveKey="first"
    transition={false}
    id="noanim-tab-example"
    className="">

  <Tab eventKey="first" title="Categories">
    <button className='categoryPlusBtn btn btn-primary me-md-2 rounded-circle'><i className="fa fa-plus"></i></button>
    < CategoriesTable/>
  </Tab>

  <Tab eventKey="second" title="Books">
    <button className='booksPlusBtn btn btn-primary me-md-2 rounded-circle'><i className="fa fa-plus"></i></button>
    < BooksTable/>
  </Tab>

  <Tab eventKey="third" title="Authors" >
  <button className='authersPlusBtn btn btn-primary me-md-2 rounded-circle'><i className="fa fa-plus"></i></button>
  </Tab>
</Tabs>
    </div>
  );
}

export default ThreeTabs;
